import React from 'react'
import { Container, Col, Row, Navbar, Nav} from 'react-bootstrap'
import '../resources/css/custom.css'

const NavBar = (props) => {
return (
    <div>
        <Navbar>
            <Container className='custom-font'>
            <Nav.Link href="/"><h4>HOME</h4></Nav.Link>
            </Container>

        </Navbar>
    </div>
)
}
export default NavBar;
